import React from 'react';
import './Home.css';
import { RouteComponentProps } from 'react-router-dom'

interface HomeProps extends RouteComponentProps<{ id: string }> {}

const Home: React.FC<HomeProps> = ({ history, location, match }) => {
    console.log(match)
    console.log(match.params.id)

    React.useEffect( () => {
        fetch(`api.example.com/posts/${ match.params.id }`)
    }, [match.params.id])

    return (
        <div id="Home">
            <h1>Home Page Showing</h1>

            <button
                onClick={ () => {
                    // Can call API 
                    // Change to product page
                    history.push('/product')
                }}
            >
                Click Me to go Product
            </button>
        </div>
    )
}

export default Home
